  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch data from the API



    async function fetchData() {
      await fetch('http://localhost:3001/webcategories')
        .then((response) => response.json())
        .then((data) => {
          console.log("Navigation DATA ");

          console.log(data);
          setWebCategoryData(data);
          setLoading(false);
        })
        .catch((error) => {
          console.error('Error fetching data:', error);
          setLoading(false);
        });

      await fetch('http://localhost:3001/navigations')
        .then((response) => response.json())
        .then((data) => {
          console.log("WEB DATA ");
          console.log(data);
          setNaviationData(data);
          setLoading(false);
        })
        .catch((error) => {
          console.error('Error fetching data:', error);
          setLoading(false);
        });

      console.log(navigationData);
      console.log(webCategoryData);
      console.log(loading);

    }

    fetchData();

  }, []);


  return (
    <div className="App">
      <ComponentLv1 />
      <p>{JSON.stringify(navigationData) }</p>

      <br></br>

      <p>{JSON.stringify(webCategoryData)}</p>

    </div>
  );
}

export default App;
